pub enum Entry<'a> {
    Doc {
            metric_name: &'a str,
            doc: &'a str,
        },
    Type {
            metric_name: String,
            sample_type: MetricKind,
        },
    Metric {
            metric_name: &'a str,
            labels: Option<&'a str>,
            value: &'a str,
            timestamp: Option<&'a str>,
        },
    Empty,
    Ignored,
}
